    const BATCH_SIZE = 2000;

    async function fetchBatchData(keys, data_keys, selectedType) {
        const allFinalData = [];

        // Split into batches
        for (let i = 0; i < keys[selectedType].length; i += BATCH_SIZE) {
            const keyBatch = keys[selectedType].slice(i, i + BATCH_SIZE);
            const dataKeyBatch = data_keys[selectedType].slice(i, i + BATCH_SIZE);

            console.log(` Processing batch ${i / BATCH_SIZE + 1} with ${keyBatch.length} items`);

            // Fetch TM values
            const tmResponse = await fetch("https://api.ms-tech.in/v14/get-multiple-hashes-4g", {
                method: "POST",
                headers: { "Content-Type": "application/json" },
                body: JSON.stringify({
                    keys: keyBatch,
                    fields: ["tm", "cv", "csq"]
                }),
            });

            const tmData = await tmResponse.json();

            // Fetch SD values
            const tmdataResponse = await fetch("https://api.ms-tech.in/v14/get-multiple4g-data", {
                method: "POST",
                headers: { "Content-Type": "application/json" },
                body: JSON.stringify({
                    keys: dataKeyBatch,
                    fields: ["sd"]
                }),
            });

            const tmDatar = await tmdataResponse.json();

            // Convert TM response into map for easy lookup
            const tmMap = {};
            for (const item of tmData.data || []) {
                const id = item.key.replace(/^v_/, ""); // remove v_
                tmMap[id] = item.data.tm || null;
                tmMap[`${id}_cv`] = item.data.cv || null;
                tmMap[`${id}_csq`] = item.data.csq || null;
            }

            for (const item of tmDatar.data || []) {
                const id = item.key.replace(/^angw_/, "");
                tmMap[`${id}_sd`] = item.data.sd || null;
            }

            // Merge TM into logs
            const finalData = keyBatch.map(node => {
                const key = node.replace(/^v_/, "");

                return {
                    node_id: key,
                    tm: tmMap[key] || null,
                    cv: tmMap[`${key}_cv`] || null,
                    csq: tmMap[`${key}_csq`] || null,
                    sd: tmMap[`${key}_sd`] || null,
                };
            });

            allFinalData.push(...finalData);

            // Optional: Add a small delay to prevent server overload
            await new Promise(res => setTimeout(res, 300));
        }

        console.log(" All Batches Completed:", allFinalData.length);
        setData(allFinalData);
    }
